      WorkspaceFileValue workspaceFileValue=(WorkspaceFileValue)env.getValue(workspaceFileKey);
      return RepositoryMapping.createAllowingFallback(workspaceFileValue.getRepositoryMapping().getOrDefault(repoName,ImmutableMap.of()));
    }
  }
  if (key instanceof BzlLoadValue.KeyForBzlmod) {
    if (repoName.equals(RepositoryName.BAZEL_TOOLS)) {
      return RepositoryMapping.ALWAYS_FALLBACK;
    }
    if (repoName.isMain()) {
      RepositoryMappingValue repositoryMappingValue=(RepositoryMappingValue)env.getValue(RepositoryMappingValue.KEY_FOR_ROOT_MODULE_WITHOUT_WORKSPACE_REPOS);
      if (repositoryMappingValue == null) {
        return null;
      }
      return repositoryMappingValue.getRepositoryMapping();
    }
  }
  RepositoryMappingValue repositoryMappingValue=(RepositoryMappingValue)env.getValue(RepositoryMappingValue.key(repoName));
  if (repositoryMappingValue == null) {
    return null;
  }
  return repositoryMappingValue.getRepositoryMapping();
}
